import {
    Box,
    Container,
    Grid,
    Paper,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableRow,
    Typography,
} from "@material-ui/core";
import Skeleton from "@material-ui/lab/Skeleton";
import React from "react";

// const container = css`
//     width: 100%;
// `;

// const header = css`
//     width: 100%;
//     margin-bottom: 80px;
// `;

const AppSkeleton = () => {
    const renderCell = () => (
        <TableCell>
            <Skeleton variant="rect" height={20} />
        </TableCell>
    );

    const renderRow = () => (
        <TableRow>
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
        </TableRow>
    );

    return (
        <div>
            <div>
                <Skeleton variant="rect" height={50} />
            </div>
            <Container maxWidth={"lg"}>sdf</Container>
        </div>
    );
};

export default AppSkeleton;
